import "../Programs/Programs.css";

const Programs = () => {
  return (
    <div className="programs" id="programs">
      <div className="program-header">
        <span>Explore Our</span>
        <span>Programs</span>
        <span>To Shape You</span>
      </div>
    </div>
  );
};

export default Programs;
